  \"2016-05-25T00:43:39.797192\",\n\t\"name\": \"designee-management-system\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In 2004, the Government Accountability Office
  (GAO) conducted an audit of the Delegation Program for the Federal Aviation Administration's
  (FAA) Office of Aviation Safety (AVS). The audit findings noted a lack of consistent
  and effective management of Designees AVS-wide, lack of measurable data to ensure
  quality work from Designees, and lack of accountability from both Designees and
  FAA for those measures. Designees are private individuals or organizations delegated
  to act as representatives of the FAA Administrator.FAA demands the highest technical
  and ethical standards from its Designees, which strengthens public, congressional,
  and industry confidence in aviation safety. In answer to the GAO audit, the Designee
  Management System (DMS) has been designed to meet FAA requirements to more effectively
  monitor Designee activities performed for AVS's Office of Aviation Medicine (AAM),
  Flight Standards Service (AFS), and Aircraft Certification Service (AIR).\",\n\t\"license_title\":
